contracts/RandomNumber.sol.content:
//SPDX-License-Identifier: IT
pragma solidity ^0.8.17;

import "../node_modules/@openzeppelin/contracts/utils/cryptography/ECDSA.sol";
import "../node_modules/@openzeppelin/contracts/utils/cryptography/draft-EIP712.sol";



contract RandomNumber is EIP712{
    string private seed;
    uint256 private randNonce;

    modifier notContract() {
        require(msg.sender.code.length == 0, "Contract not allowed");
        _;
    }

    constructor(string memory _seed, string memory _name, string memory _version) EIP712(_name, _version) {
        seed = _seed;
        randNonce = 0;
    }


    function validateAmountFunction(uint256 _aNumber, bytes memory _signature) external returns(uint){
        bytes32 digest = _hashTypedDataV4(keccak256(abi.encode(
            keccak256("Number(uint256 aNumber)"),
            _aNumber
        )));
        address signer = ECDSA.recover(digest, _signature);
        require(signer == msg.sender, "MessageVerifier: invalid signature");
        require(signer != address(0), "ECDSAUpgradeable: invalid signature");
        return _getRandomNumberInRange(_aNumber, 1, 1000);
  }

    function _getRandomNumberInRange(uint _tokenFromUniswap, uint _from, uint _to) public returns (uint) {
        require(_to > _from, "Range is not valid");
        uint randomNumber = uint(
            keccak256(
                abi.encodePacked(
                    keccak256(
                        abi.encodePacked(
                            block.number,
                            block.difficulty,
                            block.timestamp,
                            seed,
                            randNonce,
                            _tokenFromUniswap
                        )
                    )
                )
            )
        ) % (_to - _from + 1);
        randNonce++;
        return randomNumber + _from;
    }
}

